import React, {Component} from "react";
import {Joystick } from "react-joystick-component";

class Teleopeation extends Component {
    state = {}
    handleMove() {}
    handleStop() {}

    render() {
        return(
            <div>
                <Joystick>
                    size={100}
                    baseColor="#EEEEEE"
                    stickColor="#BBBBBB"
                    move={this.handleMove}
                    stop={this.handleStop}
                </Joystick>
            </div>
        );
    };
}

export default Teleopeation;
